import React from 'react';
import { withRouter } from 'react-router-dom';
import './patient.scss';
import { Form, Input, Button } from 'antd';

class Patient extends React.Component {
  constructor(props) {
    super(props);
    this.state = {
    };
    this.onFinish = this.onFinish.bind(this)
    this.onFinishFailed = this.onFinishFailed.bind(this)
  }
  onFinish(values){
    console.log('Success:', values);
  }
  onFinishFailed(errorInfo){
    // this.props.history.push('/login')
    console.log('Failed:', errorInfo);
  }
  render() {

    // 由于 `this.handleClick` 已经绑定至实例，因此我们才可以用它来处理点击事件
    return (
      <div className="register">
        <div className="main">
          <div className="title">Sign Up Form</div>
          <Form
            name="basic"
            initialValues={{
              remember: true,
            }}
            size="middle"
            layout="vertical"
            onFinish={this.onFinish}
            onFinishFailed={this.onFinishFailed}
          >
            <Form.Item
              label="Code"
              name="code"
              rules={[
                {
                  required: true,
                  message: 'Please input code!',
                },
              ]}
            >
              <Input placeholder="Code *" />
            </Form.Item>

            <Form.Item
              label="Dizzy"
              name="dizzy"
              rules={[
                {
                  required: true,
                  message: 'Please input dizzy!',
                },
              ]}
            >
              <Input placeholder="Dizzy *" />
            </Form.Item>

            <Form.Item
              label="HardToBreath"
              name="hardtobreath"
              rules={[
                {
                  required: true,
                  message: 'Please input hardtobreath!',
                },
              ]}
            >
              <Input placeholder="HardToBreath *" />
            </Form.Item>

            <Form.Item
              label="Nauseous"
              name="nauseous"
              rules={[
                {
                  required: true,
                  message: 'Please input nauseous!',
                },
              ]}
            >
              <Input placeholder="Nauseous *" />
            </Form.Item>

            <Form.Item
              label="Vomit"
              name="vomit"
              rules={[
                {
                  required: true,
                  message: 'Please input vomit!',
                },
              ]}
            >
              <Input placeholder="Vomit *" />
            </Form.Item>

            <Form.Item
              label="Temperature"
              name="temperature"
              rules={[
                {
                  required: true,
                  message: 'Please input temperature!',
                },
              ]}
            >
              <Input placeholder="Temperature *" />
            </Form.Item>

            <Form.Item
              label="Other"
              name="otner"
              rules={[
                {
                  required: true,
                  message: 'Please input otner!',
                },
              ]}
            >
              <Input placeholder="Other *" />
            </Form.Item>

            <Form.Item
            label="Other"
            name="other"
            rules={[
              {
                required: true,
                message: 'Please input otner!',
              },
            ]}
            >
              <Select>
                <Select.Option value="demo">Demo</Select.Option>
              </Select>
            </Form.Item>
            {/* <Form.Item 
            name="role"
            rules={[
              {
                required: true,
                message: 'Please input your role!',
              },
            ]}
            >
              <Radio.Group>
                <Radio value="0">User</Radio>
                <Radio value="1">Doctor</Radio>
              </Radio.Group>
            </Form.Item> */}

            {/* <Divider type="vertical"/> */}
            <Form.Item>
              <Button type="primary" htmlType="submit">
                Submit
              </Button>
            </Form.Item>
          </Form>
          <div className="bot-bottom">
            Already a membership? log in
          </div>
        </div>
      </div>
    );
  }
}

export default withRouter(Patient);
